bh_learn_more_str_3="<b>Access Point</b></p><p> If you want to get better WiFi performance and coverage beyond what you have with your existing gateway, and you prefer to connect to your router using a WiFi connection, set up your router in extender mode. To set up this mode, connect your new router to your existing router or gateway's WiFi network. You can connect wired devices to your existing gateway and connect wired and WiFi devices to your new router."
