bh_learn_more_str_4="In extender mode, by default, the new router's IP address is assigned by your gateway dynamically. However, you can still use <a target='_blank' href='http://www.routerlogin.net' class='linktype'>http://www.routerlogin.net </a>to access the router web interface from a device connected to the router. Some router features are not available in extender mode. You must use router mode if you want to use those features.</p>"
